import React from 'react';
import { Product } from "./Product";

export const ItemGrid = props => {
    const product = props.boxs.slice(0, props.limit);
    const showProduct = product.map(box => { 
        return <Product
            key={props.image}
            name={box.name}
            price={box.price}
            image={box.image}
        />
    });

    return (
        <div className='container grid-three-column'>
            {props.showProduct}
        </div>
    );
}
